def can_walk_exact_distance(n: int, k: int, s: int) -> str:
    """"""
    if (n - 1) * k < s:
        return 'NO'
    if k > s:
        return 'NO'
    curr = 1
    result = ['YES']
    while s > 0:
        d = min(n - 1, s - k + 1)
        s -= d
        k -= 1
        if curr + d <= n:
            curr += d
        else:
            curr -= d
        result.append(str(curr))
    return ' '.join(result)
